    /// Paying with Apple Pay
    /// 
    /// Information shared when you make a payment
    /// When you begin a payment within an app or on the web using Apple Pay, to enable tax and shipping cost calculation, your zip code, postal code, or other equivalent information is provided to the app, website, or merchant. After you authorize the payment, other information requested by the merchant, such as a device-specific account number, your shipping address, or email address, is also provided. The card number from your credit, debit, or prepaid card is not provided when you use Apple Pay.
    /// 
    /// Apps and websites can check if you have set up Apple Pay
    /// When using an app or a website that uses Apple Pay in iOS, watchOS, or macOS, the app or website can check if you have Apple Pay enabled on that device. When visiting a website in Safari on an iOS device, or Mac to which a card cannot be added, the website can check if you have Apple Pay set up on an iPhone or Apple Watch using the same iCloud account. You may disable websites you visit from checking if Apple Pay is enabled by changing your settings. On iOS go to Settings > Safari > Check for Apple Pay. On macOS, go to Safari > Preferences > Privacy and uncheck “Allow websites to check if Apple Pay is set up.”
    /// 
    /// Apple transmits, but does not store, your payment information
    /// In order to securely transmit your payment information within apps and websites, the information is sent to Apple in encrypted form, where it is briefly decrypted and re-encrypted with a merchant-specific key, so that only the merchant, the developer, or their payment processor can decrypt your payment information. When you make a payment on a Mac to which a card cannot be added, the Mac and the authorizing device communicate over an encrypted channel via Apple servers. Apple does not retain any of this information in a form that personally identifies you.
